(25, 72, NULL, 1, NULL, 'Tes Golongan Darah', 'Hai teman,buat teman teman yang belum mendapat kesempatan acara ini insya allah tahun depan akan diadakan lagi\nIni sebenernya acara perdana Esktrakulikuler kita yaitu PMR(Palang Merah Remaja) tujuan dari acara ini sih untuk membantu teman teman kita yang belum mengetahui golongan darah mereka\n"Acara ini telah sukses namun bukan berarti kami semua berbangga hati disini,masih banyak kekurangan dari kami dan kami akan terus memperbaiki kekurangan itu,Insya allah ini akan menjadi Program tahunan yang akan di laksanakan PMR dengan sekolah dan beberapa kerja sama organisasi lain"Ujar Panitia Golongan Darah tersebut\nselain tanggapan dari panitia ada juga nih tanggapan dari teman teman kita\n"awalnya saya sangat takut ketika melihat jarum suntik bahkan saya hampir membatalkan ikut acara,namun semua sirna setelah beberapa rekan saya dan panitia membujuk saya untuk tetap ikut alhasil saya mengikutinya memang saya sedikit merasakan sakit,saya harap ini akan menjadi acara rutin sekolah mengingat golongan darah itu penting"Ujar salah seorang siswa yang mengikuti acara\n\n<div class="separator" style="font-family: Georgia, serif; font-size: 10pt; font-style: normal; font-variant: normal; font-weight: normal; line-height: 20.796875px; color: rgb(42, 55, 47); background-color: rgb(255, 255, 255); clear: both; text-align: center;"><br></div><div class="separator" style="font-family: Georgia, serif; font-size: 10pt; font-style: normal; font-variant: normal; font-weight: normal; line-height: 20.796875px; color: rgb(42, 55, 47); background-color: rgb(255, 255, 255); clear: both; text-align: center;"><img border="0" height="240" src="http://2.bp.blogspot.com/--KHI8xd3s1I/T1IsaCUmDcI/AAAAAAAABLM/LeTtkhZB2nM/s320/Foto-0013.jpg" width="320" style="border: 0px solid rgb(204, 204, 204); padding-top: 4px;"></div><div class="separator" style="font-family: Georgia, serif; font-size: 10pt; font-style: normal; font-variant: normal; font-weight: normal; line-height: 20.796875px; color: rgb(42, 55, 47); background-color: rgb(255, 255, 255); clear: both; text-align: center;"><img border="0" height="240" src="http://1.bp.blogspot.com/-MQTcKRpiRg8/T1It3B3bxiI/AAAAAAAABL8/aWORwrL2wCg/s320/Foto-0070.jpg" width="320"></div>', 'Foto-0068.jpg', 1, 0, '2013-08-15', '2013-08-15'),
