(33, 72, NULL, 2, 1, 'Manfaat memaca Al-Qur''an', 'Assalamu''alaikum WR. WB.<div><span style="font-size: 10pt;">Al Quran sebagai wahyu dari Allah SWT yang diturunkan kepada Baginda Nabi besar Muhammad SAW yang menjadi pedoman bagi setiap umat manusia sebagai pedoman hidup guna menunjukkan kepada jalan kebaikan dan kebenaran, mengingatkan manusia agar berpegang teguh pada Al Quran untuk selamat di Dunia dan Akhirat.&nbsp;</span><strong transparent;="" border:="" 0px;="" margin:="" padding:="" vertical-align:="" baseline;"="" style="font-size: 10pt;">Jika suatu buku memiliki suatu nilai manfaat dari setiap isinya, maka alquran banyak memiliki manfaat dan menjadi tuntunan hidup atau pegangan manusia dalam hidup didunia</strong><span style="font-size: 10pt;">.</span><strong transparent;="" border:="" 0px;="" margin:="" padding:="" vertical-align:="" baseline;"="" style="font-size: 10pt;"><span transparent;="" border:="" 0px;="" margin:="" padding:="" vertical-align:="" baseline;="" color:="" rgb(0,="" 0,="" 255);="" background-position:="" initial="" initial;="" background-repeat:="" initial;"="">&nbsp;Bahkan Al Quran memiliki keistimewaan bagi setiap orang yang membacanya, bahkan dalam sabda Rasulullah SAW yang berbunyi :</span></strong></div><div><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"=""><strong transparent;="" border:="" 0px;="" margin:="" padding:="" vertical-align:="" baseline;"=""><span transparent;="" border:="" 0px;="" margin:="" padding:="" vertical-align:="" baseline;="" color:="" rgb(0,="" 0,="" 255);="" background-position:="" initial="" initial;="" background-repeat:="" initial;"="">” Ibadah yang paling istimewa adalah membaca Al Quran dan mengamalkannya dalam kehidupan sehari-hari”. Bahkan dari tiap 1 ayat yang dibaca mengandung 10 kebaikan di dalamnya. Karena keistimewaan Al Quran mampu membuat hidup manusia menjadi aman dan tentram.</span></strong></p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" text-align:="" center;"=""><strong transparent;="" border:="" 0px;="" margin:="" padding:="" vertical-align:="" baseline;"=""><img class="size-full wp-image-16 aligncenter" title="AlQuran" src="http://belajarbacaalquran.com/wp-content/uploads/2011/10/AlQuran.jpg" alt="" width="489" height="367" transparent;="" border:="" 0px;="" margin:="" 0px="" auto="" 12px;="" padding:="" vertical-align:="" baseline;="" clear:="" both;="" display:="" block;="" max-width:="" 100%;="" height:="" auto;="" background-position:="" initial="" initial;="" background-repeat:="" initial;"=""></strong></p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"=""><strong transparent;="" border:="" 0px;="" margin:="" padding:="" vertical-align:="" baseline;"="">Berikut ini sepenggalan manfaat mempelajari, membaca dan mengamalkan Al Quran, diantaranya adalah :</strong></p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">1. Dari tiap ayat Al Quran yang dibaca mengandung 10 kebaikan di dalamnya</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">2. Al Quran sebagai pedoman hidup manusia untuk menuntun kepada jalan kebaikan, kebenaran dan keselamatan</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">3. Al Quran sebagai penyejuk hati bagi siapa saja yang membacanya</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">4. Al Quran mampu memotivasi diri dan pemberi semangat</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">5. Al Quran sebagai sebuah peringatan besar dan teguran akan sifat dan perilaku manusia</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">6. Al Quran sebagai pelebur segala emosi dan amarah yang mampu mendamaikan dan memberi ketenangan yang tidak dapat dilukiskan atau digambarkan seperti halnya yang terjadi pada Sayyid Quthb Rahimakumullah</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">7. Al Quran sebagai sarana komunikasi diri dengan Allah SWT</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">8. Al Quran sebagai pengingat akan kebesaran Allah SWT</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">9. Dalam sebuah janjiNya, Allah SWT berjanji akan memberikan segala kebutuhan dan mencukupi segala kehidupan manusia di dunia dan di akhirat serta mengangkat derajat manusia meski di dunia hidup penuh dengan segala kekurangan</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">10. Al Quran akan menjadi pelindung diri bagi siapa saja yang membacanya dari tiap ayat yang dibacanya</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">11. Al Quran bagi siapa saja yang memahami dan mengamalkannya dalam kehidupan sehari-hari akan semakin bertambah ilmunya</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">12. Siapa saja yang mempelajari dan memahami Al Quran bagaikan menyelami luasnya samudera kehidupan dan menikmati anugerah kehidupan yang dirasakannya serta mengambil segala hikmah dan manfaat dari Al Quran</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">13. Seseorang yang rajin membaca Al Quran memiliki jiwa yang sejuk, penuh dengan kesabaran, hati yang jernih, jiwa dan pikiran yang lapang, dan wajah yang bercahaya</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">14. Menjadikan seorang yang kreatif, penuh motivasi dan inovatif</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">15. Membuat manusia semakin dekat dengan Sang Maha Pencipta Dunia dengan segala isinya</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">16. Membuat seseorang menjadi bersyukur dengan segala nikmatNya</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">17. Terhindar dari segala kecemasan, kekhawatiran, rasa pesimis, kesedihan, selalu penuh dengan harapan dan kegembiraan</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">18. Selalu mendapat jalan kemudahan, kebaikan dan petunjuk serta mengingatkan diri dari hal-hal yang dilarangNya</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">19. Bagi seseorang yang membaca dan mengamalkannya, merasakan senantiasa dalam setiap langkahnya selalu dilindungi oleh Allah SWT</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">20. Sebagai pelebur dosa, yang mengingatkan manusia akan dosa-dosa dan mencegah dirinya kembali dalam dosa</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">21. Memperkuat keimanan, ketaqwaan dan penjagaan diri</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">22. Memudahkan segala rizki</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">23. Sebagai pintu keberkahan bagi siapa saja yang membacanya</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">24. Dijadikan sebagai manusia yang terbaik</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">Dari `Utsman bin `Affan, dari Nabi bersabda : “Sebaik-baik kalian yaitu orang yang mempelajari Al Qur`an dan mengajarkannya.” H.R. Bukhari.</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">25. Akan dikumpulkan bersama para Malaikat Allah</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">Dari `Aisyah Radhiyallahu `Anha berkata, Rasulullah bersabda : “Orang yang membaca Al Qur`an dan ia mahir dalam membacanya maka ia akan dikumpulkan bersama para Malaikat yang mulia lagi berbakti. Sedangkan orang yang membaca Al Qur`an dan ia masih terbata-bata dan merasa berat (belum fasih) dalam membacanya, maka ia akan mendapat dua ganjaran.” Muttafaqun `Alaihi (Keuntungan dan kebaikan).</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">26. Sebagai syafa`at dan penyelamat di Hari Kiamat</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">Dari Abu Umamah Al Bahili t berkata, saya telah mendengar Rasulullah bersabda : “Bacalah Al Qur`an !, maka sesungguhnya ia akan datang pada Hari Kiamat sebagai syafaat bagi ahlinya (yaitu orang yang membaca, mempelajari dan mengamalkannya).” H.R. Muslim.</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">27. mendapatkan segala kenikmatan yang tiada batasnya</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">Dari Ibnu `Umar, dari Nabi bersabda : “Tidak boleh seorang menginginkan apa yang dimiliki orang lain kecuali dalam dua hal; (Pertama) seorang yang diberi oleh Allah kepandaian tentang Al Qur`an maka dia mengimplementasikan (melaksanakan)nya sepanjang hari dan malam. Dan seorang yang diberi oleh Allah kekayaan harta maka dia infaqkan sepanjang hari dan malam.” Muttafaqun `Alaihi.</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">28. Sebagai ladang pahala</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">Dari Abdullah bin Mas`ud t berkata, Rasulullah e : “Barangsiapa yang membaca satu huruf dari Kitabullah (Al Qur`an) maka baginya satu kebaikan. Dan satu kebaikan akan dilipat gandakan dengan sepuluh kali lipat. Saya tidak mengatakan “Alif lam mim” itu satu huruf, tetapi “Alif” itu satu huruf, “Lam” itu satu huruf dan “Mim” itu satu huruf.” H.R. At Tirmidzi dan berkata : “Hadits hasan shahih”.</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">29. Untuk Kedua orang tuanya mendapatkan mahkota dan kenikmatan surga</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">Dari Muadz bin Anas t, bahwa Rasulullah e bersabda : “Barangsiapa yang membaca Al Qur`an dan mengamalkan apa yang terdapat di dalamnya, Allah akan mengenakan mahkota kepada kedua orangtuanya pada Hari Kiamat kelak. (Dimana) cahayanya lebih terang dari pada cahaya matahari di dunia. Maka kamu tidak akan menduga bahwa ganjaran itu disebabkan dengan amalan yang seperti ini. ” H.R. Abu Daud.</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">30. Mendapatkan kenikmatan Syurga dan di penuhinya segala apa yang diinginkan</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"="">Mungkin ketika di dunia hidup dalam serba keterbatasan dan kekurangan, karena rajin membaca serta mengamalkannya dalam kehidupan sehari-hari, menjadikannya sebagai pribadi yang tangguh, taat dan menjalankan perintah dan laranganNya. Niscaya akan mendapatkan kenikmatan luar biasa yang tidak pernah di dapat ketika di dunia.</p><p rgb(255,="" 255,="" 255);="" border:="" 0px;="" margin:="" 0px="" 24px;="" padding:="" vertical-align:="" baseline;="" color:="" rgb(51,="" 51,="" 51);="" font-family:="" georgia,="" ''bitstream="" charter'',="" serif;="" font-size:="" 16px;="" line-height:="" 24px;"=""><em transparent;="" border:="" 0px;="" margin:="" padding:="" vertical-align:="" baseline;"="">Masih banyak manfaat dan keutamaan lainnya dari membaca Al Quran</em>&nbsp;yang bila kita mengilhami dan terus mempelajarinya tak akan mampu menghitung berapa banyak manfaat dan anugerah serta nikmat yang telah diberikan-Nya.</p></div>', 'iCan___Kaito_Kid_by_Arciam4.jpg', 1, 0, '2013-08-15', '2013-08-15'),
